import React from "react";
import { Link } from "react-router-dom";
import "./css/nav.css";
function Nav() {
  return (
    <div className="nav">
      <h1 id="nn">GAMING HUB</h1>
      <Link to="/home" id="nh">
        HOME
      </Link>
      <Link id="nu" className="link">
        UPCOMMING-MATCHES
      </Link>
      <Link id="nr" className="link">
        RESULT
      </Link>
      <Link id="np" className="link">
        PROFILE
      </Link>
    </div>
  );
}
export default Nav;
